import { SiJavascript, SiJava, SiPython } from "react-icons/si";

function Langage({ Icon, titre, details, niveau }) {
	return (
		<div className='langage-programmation'>
			<div className='header'>
				<Icon size='30px' className='image' />
				<span className='titre'>{titre}</span>
			</div>
			<div className='details'>{details}</div>
			<div className="niveau">{niveau}</div>
		</div>
	);
}

export default function Code() {
	return (
		<div className='langages-programmation-container'>
			<div className='langages-programmation-div'>
				<Langage Icon={SiJavascript} titre='JavaScript' details='JS - NodeJS - ReactJS' niveau='Coup de cœur'/>
				<Langage Icon={SiJava} titre='Java' niveau='Étudié en profondeur'/>
				<Langage Icon={SiPython} titre='Python' details='Tkinter - Impératif / Objet' />
				<Langage Icon={SiJavascript} titre='JavaScript' details='JS - NodeJS - ReactJS' />
				<Langage Icon={SiJavascript} titre='JavaScript' details='JS - NodeJS - ReactJS' />
			</div>
		</div>
	);
}
